import React, { Component } from 'react'
import Img1 from '../../assets/images/feature-left.jpg'
import Img2 from '../../assets/images/feature-right.jpg'
import {FaPlay} from 'react-icons/fa'

class Landing extends Component {
    render() {
        return (
            <section className='landing d-flex justify-content-between gap-3 w-100'>
                <img src={Img1} alt="details" className='rounded-5' />
                <div className='video position-relative'>
                    <img src={Img2} alt="details" className='rounded-5' />
                    <span className='position-absolute left-half top-half rounded-5 bg-white d-flex justify-content-center align-items-center p-3'>
                        <FaPlay className='text-pink'/>
                    </span>
                </div>
            </section>
        )
    }
}

export default Landing;
